import React from "react";
import "./App.css";
import * as data from "./data.json";

function Card(props) {
  return <div className={"card"}>{props.children}</div>;
}

function WeatherDisplay() {
  return <p>{data.weather[0].description}</p>;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Card>
          {" "}
          Some Card
          <WeatherDisplay />
        </Card>
      </header>
    </div>
  );
}

export default App;
